.cucumber-report-header {
  width: 100%;
  display: grid;
  grid-template-columns: 1fr;
  border: 1px solid rgba(0, 0, 0, 0.1);

}
.cucumber-report-header > * {

  border-right: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search {

  grid-template-columns: 9fr 1fr;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search input {
  padding: 0.4em;
  border-radius: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search button {

.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul {

.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li input {

}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li label {

}

@media only screen and (min-width: 600px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: 1/-1;
  }
}
@media only screen and (min-width: 992px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr 2fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-execution-data {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: auto;
  }

.accordion {
    border: 1px solid rgba(0, 0, 0, 0.1);

}

.accordion__item + .accordion__item {
    border-top: 1px solid rgba(0, 0, 0, 0.1);

.accordion__button {
    background-color: #f4f4f4;
    color: #444;
    cursor: pointer;
    padding: 10px;
    width: 100%;
    text-align: left;
    border: none;
}

.accordion__button:hover {
    background-color: #ddd;
}

.accordion__button:before {
    display: inline-block;
    content: '';
    height: 10px;
    width: 10px;
    margin-right: 12px;
    border-bottom: 2px solid currentColor;
    border-right: 2px solid currentColor;
    transform: rotate(-45deg);
}

.accordion__button[aria-expanded='true']::before,
.accordion__button[aria-selected='true']::before {
    transform: rotate(45deg);
}

.accordion__panel {
    padding: 20px;
    animation: fadein 0.35s ease-in;
}

st/resources/features/api/1000_create_account.feature","data":"@smoke @api @createAccount\nFeature: Create Account - api\n\n  Scenario Outline: Create account \u003ctestCase\u003e \u003cexpectedResult\u003e \u003cresponse\u003e\n    Given the account creation endpoint is \"?controller\u003dauthentication\u0026back\u003dmy-account\"\n\n    And I want to create an account with the following attributes:\n      | email   | firstName   | lastName   | password   |\n      | \u003cemail\u003e | \u003cfirstName\u003e | \u003clastName\u003e | \u003cpassword\u003e |\n\n    And with the following address information:\n      | firstName | lastName | address            | city    | state | zip   | country       | mobilePhone | addressAlias |\n      | John      | Doe      | Stresemannlaan 001 | Haarlem | Texas | 20300 | United States | 0686433030  | summerhouse  |\n\n    When I save the new account by api \u0027\u003ctestCase\u003e\u0027\n    Then the save \u0027\u003cexpectedResult\u003e\u0027\n    And the response on api should be: \u0027\u003cresponse\u003e\u0027\n\n    Examples:\n      | testCase             | expectedResult | email               | firstName | lastName | password | response                                                         |\n#      email registration test cases\n      | WITHOUT EMAIL        | FAILS          |                     | John      | Doe      | 12345    | Invalid email address.                                           |\n      | WITH INVALID EMAIL   | FAILS          | qa_email            | John      | Doe      | 12345    | Invalid email address.                                           |\n      | WITH EXISTING EMAIL  | FAILS          | exist@gmail.com     | John      | Doe      | 12345    | An account using this email address has already been registered. |\n      | WITH NEW/VALID EMAIL | IS SUCCESSFUL  | qa_email_@gmail.com |           |          |          |                                                                  |\n\n#      personal information test cases ---\u003e Todo: uncomment test cases below when we have api info\n#      | WITHOUT FIRST NAME                      | FAILS          | qa_email_@gmail.com |           | Doe      | 12345    | firstname is required.                                           |\n#      | WITHOUT LAST NAME                       | FAILS          | qa_email_@gmail.com | John      |          | 12345    | lastname is required.                                            |\n#      | WITHOUT PASSWORD                        | FAILS          | qa_email_@gmail.com | John      | Doe      |          | passwd is required.                                              |\n#      | WITH INVALID PASSWORD (four characters) | FAILS          | qa_email_@gmail.com | John      | Doe      | 1234     | passwd is invalid.                                               |\n#      | WITH ALL REQUIRED FIELDS                | IS SUCCESSFUL  | qa_email_@gmail.com | John      | Doe      | 12345    | Welcome to your account.                                         |\n\n\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/mahmutkaya/workspace/com.automationpractice/src/test/resources/features/api/1000_create_account.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@smoke","id":"1179c8c8-9311-4120-a046-c90f5f09b720"},{"location":{"line":1,"column":8},"name":"@api","id":"f16cc418-b65c-457b-a09b-c77165366b86"},{"location":{"line":1,"column":13},"name":"@createAccount","id":"c0cbdcc2-ddf7-4ca3-a54f-7adafb03bf35"}],"language":"en","keyword":"Feature","name":"Create Account - api","children":[{"scenario":{"location":{"line":4,"column":3},"keyword":"Scenario Outline","name":"Create account \u003ctestCase\u003e \u003cexpectedResult\u003e \u003cresponse\u003e","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","text":"the account creation endpoint is \"?controller\u003dauthentication\u0026back\u003dmy-accoun
